import React from 'react';
import '../../css/submenu/UnlinkAccountConfirmMenu.css';
import Account from '../account.js';

class UnlinkAccountConfirmMenu extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div className="UnlinkAccountConfirmMenu">
                <h3>Are you sure you want to unlink this account?</h3>
                <div className="AccountContainer">
                    <AccountList linkedAccounts={this.props.selectedAccounts} />
                </div>
                <div className="BtnContainer">
                    <div className="SubmenuBtn">Confirm</div>
                    <div className="SubmenuBtn" id="Unlink Account" onClick={this.props.changeSubmenuState}>Cancel</div>
                </div>
            </div>
        );
    }
}

function AccountList(props) {
    const linkedAccounts = props.linkedAccounts;
    const accounts = linkedAccounts.map((accountData) => <Account key={accountData.account_id} account_id={accountData.account_id} selected={accountData.selected} onSelect={() => { }} />);

    return (
        <div className="AccountContainer">
            {accounts}
        </div>
    );
}

export default UnlinkAccountConfirmMenu;
